import React from 'react';
import { Tooltip } from 'bootstrap';

const Home = () => {

    const targetRef = React.createRef();

    // Initialisation du Tooltip
    new Tooltip(targetRef.current, {
        title: 'Ceci est un Tooltip',
    });

    return (
        <>
            <button ref={targetRef} className="btn btn-primary" type="button">
                Passer la souris sur moi
            </button>
        </>
    );
};

export default Home;
